post_text:
Thank you to all that participated in our Cupid Shuffle Plank Challenge (#hmstiktokaerobics) on TikTok. Thanks to you it has received over 13,000 views and over 30 videos have been submitted to PE teachers or the hashtag in its first week. This week in order to encourage more engagement from students, staff, families and friends, we leave the challenges up to you. You can perform any exercise, sport, or dance and make a challenge. Challenge friends and other staff members. Everyone can challenge @hmspeandhealth and at least one of our staff will engage. Several challenges have already been submitted by students and staff. Please check them out by searching the hashtag on the app.

***When submitting a video please use the hashtag #hmstiktokaerobics and @ the teacher you want to challenge ***

Thanks,

@teresiclan - Teresi
@hmspeandhealth- All Staff

